import React, { useState, useEffect } from 'react';

function Teams() {
  const [teams, setTeams] = useState([]);

  useEffect(() => {
    fetch('../db/data.json')
      .then(response => response.json())
      .then(data => {
        setTeams(data);
        console.log(data);
      });

  }, []);

  useEffect(
    async () => {
      const res = await fetch('../db/data.json');
      const json = await res.json();
      setTeams(json.results);
    }, []);
}

export default Teams
